import React, { useState } from 'react';
import Cat from './Cat';

function App() {
  const [pictures, setPictures] = useState([])

  fetch('https://aws.random.cat/meow')
    .then(res => res.json())
    .then(json => {
      setPictures(json)
    })

  return (
    <>
      <Cat catPictureUrl/>
    </>
  );
}

export default App;
